 your website unless a custom template has been applied to that post or a dedicated template exists.'=>['urls'=>[],'names'=>[],'cmp'=>['WordPress',3]],'Displays a static page unless a custom template has been applied to that page or a dedicated template exists.'=>['urls'=>[],'names'=>[],'cmp'=>['WordPress',3]],'Displays any archive, including posts by a single author, category, tag, taxonomy, custom post type, and date. This template will serve as a fallback when more specific templates (e.g. Category or Tag) cannot be found.'=>['urls'=>[],'names'=>[],'cmp'=>['WordPress',3]],'Displays a single author\'s post archive. This template will serve as a fallback when a more specific template (e.g. Author: Admin) cannot be found.'=>['urls'=>[],'names'=>[],'cmp'=>['WordPress',3]],'Category Archives\\4Template name'=>['urls'=>[],'names'=>[],'cmp'=>['WordPress',3]],'Displays a post category archive. This template will serve as a fallback when a more specific template (e.g. Category: Recipes) cannot be found.'=>['urls'=>[],'names'=>[],'cmp'=>['WordPress',3]],'Displays a custom taxonomy archive. Like categories and tags, taxonomies have terms which you use to classify things. For example: a taxonomy named "Art" can have multiple terms, such as "Modern" and "18th Century." This template will serve as a fallback when a more specific template (e.g. Taxonomy: Art) cannot be found.'=>['urls'=>[],'names'=>[],'cmp'=>['WordPress',3]],'Displays a post archive when a specific date is visited (e.g., example.com/2023/).'=>['urls'=>[],'names'=>[],'cmp'=>['WordPress',3]],'Displays a post tag archive. This template will serve as a fallback when a more specific template (e.g. Tag: Pizza) cannot be found.'=>['urls'=>[],'names'=>[],'cmp'=>['WordPress',3]],'Displays when a visitor views the dedicated page that exists for any media attachment.'=>['urls'=>[],'names'=>[],'cmp'=>['WordPress',3]],'Displays when a visitor performs a search on your website.'=>['urls'=>[],'names'=>[],'cmp'=>['WordPress',3